    (0000000005,NULL,00004,'03538','Howards End','E. M. Forster, Regina Marler, Benjamin DeMott','{\"Format\":\"Book\",\"Publisher\":\"Signet Classic\",\"Publication Date\":\"06\\/11\\/2007\",\"Country of Publication\":\"\",\"Edition\":\"\",\"ISBN10\":\"0451530462\",\"ISBN13\":\"9780451530462\",\"Description\":\"The classic novel explores the divisions of culture and class in late-Victorian England through the story of a disputed inheritance.\",\"Subjects\":\"\",\"Collection\":\"Fiction - Classics\",\"Control Number\":\"\",\"Cataloging Authority\":\"\",\"Reader Age (Youngest)\":\"\",\"Reader Age (Oldest)\":\"\",\"Page Count\":\"281\",\"Height\":\"\",\"Width\":\"\",\"Thickness\":\"\",\"Language\":\"en\",\"Link\":\"http:\\/\\/books.google.com\\/books?id=iaVLeokzxFIC&dq=isbn:9780451530462&hl=&source=gbs_api\"}','',NULL,'',NULL,'Link','http://books.google.com/books?id=iaVLeokzxFIC&printsec=frontcover&img=1&zoom=1&source=gbs_api','',00013,'Classics (F FOR)','',NULL,NULL,'N',NULL,NULL,'','N','Y','On Loan',0000002469,0000000001,'2021-06-17 10:19:56','2021-06-08','',0000000000,0000000823,'2012-10-04 16:04:08',0000000823,'2012-10-30 10:30:05'),
    (0000000006,NULL,00004,'03535','Tender Is the Night','F. Scott Fitzgerald','{\"Format\":\"Book\",\"Publisher\":\"Penguin Classics\",\"Publication Date\":\"1997\",\"Country of Publication\":\"\",\"Edition\":\"\",\"ISBN10\":\"0140622608\",\"ISBN13\":\"9780140622607\",\"Description\":\"To the French Riviera come Dick and Nicole Diver. Handsome, rich and glamorous, their dinners are legendary, their atmosphere magnetic. But something is wrong - Nicole has a secret and Dick a weakness. Together they head towards the rocks on which their lives crash - and only one of them really survives. Fitzgerald worked on seventeen versions of this novel, the obsessions of which consumed his marriage and his life.\",\"Subjects\":\"\",\"Collection\":\"Fiction - Classics\",\"Control Number\":\"\",\"Cataloging Authority\":\"\",\"Reader Age (Youngest)\":\"\",\"Reader Age (Oldest)\":\"\",\"Page Count\":\"392\",\"Height\":\"\",\"Width\":\"\",\"Thickness\":\"\",\"Language\":\"en\",\"Link\":\"http:\\/\\/books.google.com\\/books?id=jbZgQgAACAAJ&dq=isbn:9780140622607&hl=&source=gbs_api\"}','',NULL,'',NULL,'Link','http://books.google.com/books?id=jbZgQgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api','',00013,'Classics (F FIT)','',NULL,NULL,'N',NULL,NULL,'','N','Y','Available',NULL,NULL,NULL,NULL,'',NULL,0000000823,'2012-10-04 16:13:57',0000000823,'2012-10-30 10:38:46'),
    (0000000008,NULL,00004,'06556','Who\'s afraid of Virginia Woolf?','Edward Albee','{\"Format\":\"Book\",\"Publisher\":\"Signet\",\"Publication Date\":\"1983\",\"Country of Publication\":\"\",\"Edition\":\"\",\"ISBN10\":\"0451158717\",\"ISBN13\":\"9780451158710\",\"Description\":\"A social event becomes a personal challenge for two faculty members and thier wives at a small New England college as their inner fears and desires are exposed. Reprint.\",\"Subjects\":\"Drama\",\"Collection\":\"\",\"Control Number\":\"\",\"Cataloging Authority\":\"\",\"Reader Age (Youngest)\":\"\",\"Reader Age (Oldest)\":\"\",\"Page Count\":\"242\",\"Height\":\"\",\"Width\":\"\",\"Thickness\":\"\",\"Language\":\"en\",\"Link\":\"http:\\/\\/books.google.com\\/books?id=noSCftZGbPMC&dq=isbn:9780451158710&hl=&source=gbs_api\"}','',NULL,'',NULL,'Link','http://books.google.com/books?id=noSCftZGbPMC&printsec=frontcover&img=1&zoom=1&source=gbs_api','',00013,'Play (812.54 ALB)','',NULL,NULL,'N',NULL,NULL,'','N','Y','Available',NULL,NULL,NULL,NULL,NULL,NULL,0000000823,'2012-10-04 16:20:34',0000000689,'2017-10-12 09:33:41'),
    (0000000009,NULL,00004,'03518','Animal Farm','George Orwell, Russell Baker, Christopher Montague Woodhouse','{\"Format\":\"Book\",\"Publisher\":\"Signet Classics\",\"Publication Date\":\"1996\",\"Country of Publication\":\"\",\"Edition\":\"\",\"ISBN10\":\"0451526341\",\"ISBN13\":\"9780451526342\",\"Description\":\"Featuring a new preface, this classic satire on totalitarianism in which farm animals overthrow their human owner and set up their own government is once again brought to life for a new generation of readers. Reissue.\",\"Subjects\":\"\",\"Collection\":\"Fiction - Classics\",\"Control Number\":\"\",\"Cataloging Authority\":\"\",\"Reader Age (Youngest)\":\"\",\"Reader Age (Oldest)\":\"\",\"Page Count\":\"140\",\"Height\":\"\",\"Width\":\"\",\"Thickness\":\"\",\"Language\":\"en\",\"Link\":\"\"}','',NULL,'',NULL,'Link','http://books.google.com/books?id=SGAZdjNfruYC&printsec=frontcover&img=1&zoom=1&source=gbs_api','',00013,'Class Read 3','',NULL,NULL,'N',NULL,NULL,'','N','Y','Available',NULL,NULL,NULL,NULL,'',NULL,0000000823,'2012-10-05 08:14:04',0000000689,'2015-12-08 14:54:43'),
    (0000000010,NULL,00004,'04011','The Good Soldier vejk','Jaroslav Haek','{\"Format\":\"Book\",\"Publisher\":\"Penguin Classics\",\"Publication Date\":\"01\\/12\\/2005\",\"Country of Publication\":\"\",\"Edition\":\"\",\"ISBN10\":\"0140449914\",\"ISBN13\":\"9780140449914\",\"Description\":\"In The Good Soldier Svejk, celebrated Czech writer and anarchist Jaroslav Hasek combined dazzling wordplay and piercing satire in a hilariously subversive depiction of the futility of war. Good-natured and garrulous, Svejk becomes the Austrian army\'s most loyal Czech soldier when he is called up on the outbreak of World War I\\u2014although his bumbling attempts to get to the front serve only to prevent him from reaching it. Playing cards and getting drunk, he uses all his cunning and genial subterfuge to deal with the police, clergy, and officers who chivy him toward battle. Cecil Parrott\'s vibrant translation conveys the brilliant irreverence of this classic about a hapless Everyman caught in a vast bureaucratic machine. \\u201cBrilliant . . . Perhaps the funniest novel ever written.\\u201d \\u2014George Monbiot\",\"Subjects\":\"\",\"Collection\":\"Fiction - Classics\",\"Control Number\":\"\",\"Cataloging Authority\":\"\",\"Reader Age (Youngest)\":\"\",\"Reader Age (Oldest)\":\"\",\"Page Count\":\"752\",\"Height\":\"\",\"Width\":\"\",\"Thickness\":\"\",\"Language\":\"en\",\"Link\":\"http:\\/\\/books.google.com\\/books?id=A1hgPQAACAAJ&dq=isbn:9780140449914&hl=&source=gbs_api\"}','',NULL,'',NULL,'Link','http://books.google.com/books?id=A1hgPQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api','',00013,'Classics (F HAS)','',NULL,NULL,'N',NULL,NULL,'','N','Y','Available',NULL,NULL,NULL,NULL,'',NULL,0000000823,'2012-10-05 08:16:23',0000000823,'2012-10-30 10:09:57'),
    (0000000011,NULL,00004,'06904','Pride and Prejudice','Jane Austen, Meg Cabot','{\"Format\":\"Book\",\"Publisher\":\"Bloomsbury Pub Ltd\",\"Publication Date\":\"05\\/03\\/2007\",\"Country of Publication\":\"\",\"Edition\":\"\",\"ISBN10\":\"0747587485\",\"ISBN13\":\"9780747587484\",\"Description\":\"Elizabeth Bennet\'s chances of happiness are endangered by the foibles of human nature in this classic nineteenth-century novel.\",\"Subjects\":\"\",\"Collection\":\"Fiction - Classics\",\"Control Number\":\"\",\"Cataloging Authority\":\"\",\"Reader Age (Youngest)\":\"\",\"Reader Age (Oldest)\":\"\",\"Page Count\":\"352\",\"Height\":\"\",\"Width\":\"\",\"Thickness\":\"\",\"Language\":\"en\",\"Link\":\"http:\\/\\/books.google.com\\/books?id=tigfAAAACAAJ&dq=isbn:9780747587484&hl=&source=gbs_api\"}','',NULL,'',NULL,'Link','http://books.google.com/books?id=tigfAAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api','',00013,'Classics (F AUS)','',NULL,NULL,'N',NULL,NULL,'','N','Y','Available',NULL,NULL,NULL,NULL,'',NULL,0000000823,'2012-10-05 08:18:51',0000000823,'2012-11-07 11:42:37'),
    (0000000012,NULL,00004,'01139','The Grapes of Wrath','John Steinbeck','{\"Format\":\"Book\",\"Publisher\":\"ePenguin\",\"Publication Date\":\"26\\/04\\/2001\",\"Country of Publication\":\"\",\"Edition\":\"\",\"ISBN10\":\"0140292926\",\"ISBN13\":\"9780140292923\",\"Description\":\"Shocking and controversial when it was first published in 1939, Steinbeck\'s Pulitzer Prize-winning epic remains his undisputed masterpiece. Set against the background of dust bowl Oklahoma and Californian migrant life, it tells of the Joad family, who, like thousands of others, are forced to travel West in search of the promised land. Their story is one of false hopes, thwarted desires and broken dreams, yet out of their suffering Steinbeck created a drama that is intensely human yet majestic in its scale and moral vision; an eloquent tribute to the endurance and dignity of the human spirit.\",\"Subjects\":\"\",\"Collection\":\"Fiction - Classics\",\"Control Number\":\"\",\"Cataloging Authority\":\"\",\"Reader Age (Youngest)\":\"\",\"Reader Age (Oldest)\":\"\",\"Page Count\":\"544\",\"Height\":\"\",\"Width\":\"\",\"Thickness\":\"\",\"Language\":\"en\",\"Link\":\"http:\\/\\/books.google.com\\/books?id=rK34BBMEnoAC&dq=isbn:9780140292923&hl=&source=gbs_api\"}','',NULL,'',NULL,'Link','http://books.google.com/books?id=rK34BBMEnoAC&printsec=frontcover&img=1&zoom=1&source=gbs_api','',00013,'Classics (F STE)','',NULL,NULL,'N',NULL,NULL,'','N','Y','Available',NULL,NULL,NULL,NULL,'',NULL,0000000823,'2012-10-05 08:20:18',0000000823,'2012-10-30 10:10:47'),
    (0000000013,NULL,00004,'04986','COMPLETE FAIRY TALES, THE','Jacob W. Grimm, IRMAOS GRIMM, Wilhelm K. Grimm','{\"Format\":\"Book\",\"Publisher\":\"\",\"Publication Date\":\"20\\/05\\/2009\",\"Country of Publication\":\"\",\"Edition\":\"\",\"ISBN10\":\"1840221747\",\"ISBN13\":\"9781840221749\",\"Description\":\"Jacob Grimm (1785-1863) and his brother Wilhelm (1786-1859) were philologists and folklorists. The brothers rediscovered a host of fairy tales, telling of princes and princesses in their castles, witches in their towers and forests, of giants and dwarfs, of fabulous animals and dark deeds. Together with the well-known tales of \'Rapunzel\', \'The Goose-Girl\', \'Sleeping Beauty\', \'Hansel and Gretel\' and \'Snow White\', there are the darker tales such as \'Death\'s Messengers\' which deserve to be better known, and which will appeal not only to allwho are interested in the history of folklore, but also to all those who simply love good story-telling.\",\"Subjects\":\"\",\"Collection\":\"Fiction - Classics\",\"Control Number\":\"\",\"Cataloging Authority\":\"\",\"Reader Age (Youngest)\":\"\",\"Reader Age (Oldest)\":\"\",\"Page Count\":\"848\",\"Height\":\"\",\"Width\":\"\",\"Thickness\":\"\",\"Language\":\"en\",\"Link\":\"http:\\/\\/books.google.com\\/books?id=gxKcPwAACAAJ&dq=isbn:9781840221749&hl=&source=gbs_api\"}','',NULL,'',NULL,'Link','http://books.google.com/books?id=gxKcPwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api','',00013,'Classics (F GRI)','',NULL,NULL,'N',NULL,NULL,'','N','Y','Available',NULL,NULL,NULL,NULL,'',NULL,0000000823,'2012-10-05 08:23:52',0000000823,'2012-10-30 10:09:43'),
    (0000000014,NULL,00004,'00222','Wuthering Heights','Emily Bront','{\"Format\":\"Book\",\"Publisher\":\"Wilder Publications Limited\",\"Publication Date\":\"30\\/11\\/2007\",\"Country of Publication\":\"\",\"Edition\":\"\",\"ISBN10\":\"160459117X\",\"ISBN13\":\"9781604591170\",\"Description\":\"The tale of Heathcliff\'s and Cathy\'s ungovernable love and suffering, and the havoc that their passion wreaks on the families of the Earnshaws and the Lintons, shocked the book\'s first readers, with even Emily\'s sister Charlotte claiming Whether it is right or advisable to create beings like Heathcliff, I do not know. I scarcely think it is.\",\"Subjects\":\"\",\"Collection\":\"Fiction - Classics\",\"Control Number\":\"\",\"Cataloging Authority\":\"\",\"Reader Age (Youngest)\":\"\",\"Reader Age (Oldest)\":\"\",\"Page Count\":\"220\",\"Height\":\"\",\"Width\":\"\",\"Thickness\":\"\",\"Language\":\"en\",\"Link\":\"http:\\/\\/books.google.com\\/books?id=SluXuAAACAAJ&dq=isbn:9781604591170&hl=&source=gbs_api\"}','',NULL,'',NULL,'Link','http://books.google.com/books?id=SluXuAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api','',00013,'Classics (F BRO)','',NULL,NULL,'N',NULL,NULL,'','N','Y','Available',NULL,NULL,NULL,NULL,NULL,NULL,0000000823,'2012-10-05 08:26:07',0000000823,'2012-10-30 10:11:03'),
    (0000000015,NULL,00004,'04071','Alice\'s Adventures in Wonderland','Lewis Carroll','{\"Format\":\"Book\",\"Publisher\":\"Oxford University Press\",\"Publication Date\":\"03\\/11\\/2005\",\"Country of Publication\":\"\",\"Edition\":\"\",\"ISBN10\":\"0195971299\",\"ISBN13\":\"9780195971293\",\"Description\":\"The New Oxford Progressive English Readers offer a great selection of classic novels and plays from renowned authors that have been abridged in the form of easy-to-read stories for children to enjoy.\",\"Subjects\":\"\",\"Collection\":\"Fiction - Classics\",\"Control Number\":\"\",\"Cataloging Authority\":\"\",\"Reader Age (Youngest)\":\"\",\"Reader Age (Oldest)\":\"\",\"Page Count\":\"72\",\"Height\":\"\",\"Width\":\"\",\"Thickness\":\"\",\"Language\":\"en\",\"Link\":\"http:\\/\\/books.google.com\\/books?id=z2uMAAAACAAJ&dq=isbn:0195971299&hl=&source=gbs_api\"}','',NULL,'',NULL,'Link','http://books.google.com/books?id=z2uMAAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api','',00013,'Classics (F CAR)','',NULL,NULL,'N',NULL,NULL,'','N','Y','Available',NULL,NULL,NULL,NULL,NULL,NULL,0000000823,'2012-10-05 08:27:55',0000000823,'2012-10-30 10:08:20'),
    (0000000016,NULL,00004,'00470','Wuthering Heights','Emily Bront, Jim Pipe, Nick Spender','{\"Format\":\"Book\",\"Publisher\":\"Barrons Juveniles\",\"Publication Date\":\"01\\/04\\/2009\",\"Country of Publication\":\"\",\"Edition\":\"\",\"ISBN10\":\"0764140086\",\"ISBN13\":\"9780764140082\",\"Description\":\"Retells in graphic novel format the story of a foundling brought to Wuthering Heights and his lifelong effect on the children of two aristocratic families, and includes background information on the book, author, and timeline.\",\"Subjects\":\"\",\"Collection\":\"Fiction - Classics\",\"Control Number\":\"\",\"Cataloging Authority\":\"\",\"Reader Age (Youngest)\":\"\",\"Reader Age (Oldest)\":\"\",\"Page Count\":\"48\",\"Height\":\"\",\"Width\":\"\",\"Thickness\":\"\",\"Language\":\"en\",\"Link\":\"http:\\/\\/books.google.com\\/books?id=UupQPgAACAAJ&dq=isbn:9780764140082&hl=&source=gbs_api\"}','',NULL,'',NULL,'Link','http://books.google.com/books?id=UupQPgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api','',00013,'Classics (F BRO)','',NULL,NULL,'N',NULL,NULL,'','N','Y','Available',NULL,NULL,NULL,NULL,NULL,NULL,0000000823,'2012-10-05 08:29:39',0000000823,'2012-10-30 10:10:28');
