INSERT INTO `gibbonUnitClassBlock` (`gibbonUnitClassBlockID`, `gibbonUnitClassID`, `gibbonPlannerEntryID`, `gibbonUnitBlockID`, `title`, `type`, `length`, `contents`, `teachersNotes`, `sequenceNumber`, `complete`)
VALUES
    (00000000062210,000000005430,00000000000006,000000039667,'Want To Make Some Eye Candy?','The Pitch','5','<ul>\r\n<li>Graphic software allows us to make something out of nothing, to express our creativity.</li>\r\n<li>Do you want to learn how to make some epic wallpaper for your laptop?</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Epic Moose Wallpaper_-4kd34vi9t0b3dsi.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Epic Moose Wallpaper_-4kd34vi9t0b3dsi.png\" alt=\"\" /></a></p>','',0,'N'),
    (00000000062211,000000005430,00000000000006,000000039668,'Assessment','What To Expect','5','<ul>\r\n<li>At the end of this unit you will submit your wallpaper design as a PNG file, and this will be assessed.</li>\r\n<li>The focuses of this assessment will be:</li>\r\n<ul>\r\n<li>How attractive your design is.</li>\r\n<li>The quality and care reflected in your design work.</li>\r\n<li>Your use of CC.</li>\r\n<li>Your use of drop shadow and 3D effects.</li>\r\n<li>Your use of typography.</li>\r\n</ul>\r\n<li>You will receive a comment and an Approaches To Learning grade, but no Attainment grade.</li>\r\n</ul>','',1,'N'),
    (00000000062212,000000005430,00000000000006,000000039669,'Getting Started With Acorn','Hands On','10','<ul>\r\n<li>Acorn is software which allows you to edit graphic files.</li>\r\n<li>Can you use Spotlight to find and launch Acorn?</li>\r\n<li>Once you have launched Acorn, create a new image sized at 1680 x 1050 <span style=\"text-decoration: underline;\"><strong>pixels</strong></span> with resolution 72 <span style=\"text-decoration: underline;\"><strong>dpi</strong></span>:</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Acorn New Image Window_qo6nfntkpfxmtzf.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Acorn New Image Window_qo6nfntkpfxmtzf.png\" alt=\"\" /></a></p>\r\n<ul>\r\n<li>Save your new file as a .acorn image.</li>\r\n</ul>','',2,'N'),
    (00000000062213,000000005430,00000000000006,000000039670,'Find A CC Texture','Teacher Talk & Hands On','40','<p><strong>Creative Commons</strong></p>\r\n<ul>\r\n<li>Let\'s discuss some of the following ideas:</li>\r\n<ul>\r\n<li>Is it legal to use everything we find on the Internet?</li>\r\n<li>What is copyright law?</li>\r\n<li>Who does copyright law protect?</li>\r\n<li>What are the dangers of copyright law?</li>\r\n<li>What is Creative Commons (CC)?</li>\r\n</ul>\r\n<li>If we want to a) be creative &amp; remix and b) stay out of trouble, Creative Commons gives us a huge collection of media to work with.</li>\r\n</ul>\r\n<p><strong>Your CC Texture</strong></p>\r\n<ul>\r\n<li>The foreground (front) of your wallpaper is going to be a texture (such as a wall, or some wood, or some metal).</li>\r\n<li>Can you find a <span style=\"text-decoration: underline;\"><strong>large</strong></span> (see image below for help), <span style=\"text-decoration: underline;\"><strong>Creative Commons</strong></span> licensed texture to use?</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Google Image Search Size_8bhpcqeqhdi62-k.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Google Image Search Size_8bhpcqeqhdi62-k.png\" alt=\"\" /></a></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Once you have found the texture you want, save the <span style=\"text-decoration: underline;\"><strong>largest</strong></span> version of it you can.</li>\r\n<li>Also, bookmark the link for the page holding the image, for Creative Commons attribution later on.</li>\r\n</ul>','',3,'N'),
    (00000000062214,000000005430,00000000000006,000000039671,'Use Your Texture','Hands On','10','<ul>\r\n<li>Now that you have saved your texture, drag the file into your Acorn image.</li>\r\n<li>You might want to <span style=\"text-decoration: underline;\"><strong>resize</strong></span> your image to fit. You can do this using Layer &gt; Rotate And Transform &gt; Scale And Rotate in the top menu bar.</li>\r\n<li>You should now have something that looks like this:</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Texture In Acorn_t4xm9jhuocw5dk_6.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Texture In Acorn_t4xm9jhuocw5dk_6.png\" alt=\"\" /></a></p>','',4,'N'),
    (00000000062215,000000005430,00000000000007,000000039672,'Why So Big?','Discussion','5','<ul>\r\n<li>Why do you think we want to use only really large images in this project? Let\'s discuss this question as a class.</li>\r\n</ul>','',5,'N'),
    (00000000062216,000000005430,00000000000007,000000039673,'Layers','Teacher Talk','20','<ul>\r\n<li>I now want you to think about layers in graphics software like Acorn: I will explain the principles behind layers in graphics, so you can improve your understanding.</li>\r\n<li>Let\'s discuss why you think layers are useful?</li>\r\n<li>Do you know which file formats maintain layers?</li>\r\n<li>Did you know that in Acorn you can change the name of your layers to help keep your work organised? It can get really confusing when you have dozens of layers.</li>\r\n</ul>','',6,'N'),
    (00000000062217,000000005430,00000000000007,000000039674,'Finding A Silhouette','Hands On','15','<ul>\r\n<li>As part of your wallpaper, you will cut a hole in the foreground so we can see behind it.</li>\r\n<li>To do this you need to A) find a silhouette of the shape you want to cut out B) draw your own shape to cut out.</li>\r\n<li>Let\'s try option A first: please search the web to find a Creative Commons license&nbsp; of the shape you wish to cut out.</li>\r\n<li>Like with the texture, once you find the image you want, download it and also bookmark the page you found it from for your Creative Commons attribution.</li>\r\n<li>Hopefully you have something like this:</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Silhouette_2jbkmii-8t5qhm-u.jpg\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Silhouette_2jbkmii-8t5qhm-u.jpg\" alt=\"\" /></a></p>','',7,'N'),
    (00000000062218,000000005430,00000000000007,000000039675,'Making A Cutout','Hands On','15','<ul>\r\n<li>Now we are going to use your silhouette to make a cutout in your foreground</li>\r\n<li>Drag your saved cutout file into your wallpaper image in Acorn, and then <span style=\"text-decoration: underline;\"><strong>resize</strong></span> and <span style=\"text-decoration: underline;\"><strong>position</strong></span> as desired.</li>\r\n<li>Use the <span style=\"text-decoration: underline;\"><strong>Magic Wand</strong></span> (see image below) tool and shift key, to select all the parts of you silhouette.</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Magic Wand Select Tool_jhdh997zyqqtr_s.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Magic Wand Select Tool_jhdh997zyqqtr_s.png\" alt=\"\" /></a></p>\r\n<ul>\r\n<li>Now make the foreground layer active:</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Foreground Layer Active_pzzxc2734p5hq3zs.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Foreground Layer Active_pzzxc2734p5hq3zs.png\" alt=\"\" /></a></p>\r\n<ul>\r\n<li>Press the delete key to delete the silhouette shape from the foreground.</li>\r\n<li>Now right click on the layer with the silhouette and delete the layer. You should now see through your foreground into the transparent background:</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Cutout_iy9qvi0hgbdx2yk2.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Cutout_iy9qvi0hgbdx2yk2.png\" alt=\"\" /></a></p>','',8,'N'),
    (00000000062219,000000005430,00000000000007,000000039676,'Find A Background','Hands On','15','<ul>\r\n<li>The final main part of your wallpaper will be a background that contrasts against the foreground.</li>\r\n<li>Search online to find an interesting background image available under Creative Commons.</li>\r\n<li>Remember to bookmark the page containing the image so that you can attribute it later on.</li>\r\n<li>As an example, the following image might make a good background:</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Example Background_-67mh3_-bypt0xeu.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Example Background_-67mh3_-bypt0xeu.png\" alt=\"\" /></a></p>','',9,'N'),
    (00000000062220,000000005430,00000000000008,000000039677,'Hong Kong Style','Inspiration','15','<ul>\r\n<li>Hong Kong has its own, unique style: a result of Eastern and Western influences working side-by-side for many decades.</li>\r\n<li>If we were to create a Hong Kong-style wallpaper, what might it look like?</li>\r\n<ul>\r\n<li>Let\'s use the Think-Pair-Share thinking routine to come up with some ideas of what this might look like.</li>\r\n</ul>\r\n<li><em>I have prepared my own Epic Hong Kong Wallpaper, which is hidden in the Teacher\'s Notes.</em></li>\r\n<li style=\"text-align: left;\">We can learn about Hong Kong style using the two videos:</li>\r\n</ul>\r\n<p style=\"text-align: center;\"><iframe width=\"560\" height=\"315\" src=\"https://player.vimeo.com/video/166929892\" frameborder=\"0\" webkitallowfullscreen=\"webkitallowfullscreen\" mozallowfullscreen=\"mozallowfullscreen\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: center;\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/6YosDqsWvyU\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>','<p><a target=\"_blank\" style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2015/07/EpicHongKongWallpaperweb_t9ezjr52f0yxnmvw.png\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2015/07/EpicHongKongWallpaperweb_t9ezjr52f0yxnmvw.png\" /></a></p>',10,'N'),
    (00000000062221,000000005430,00000000000008,000000039678,'Apply Your Background','Hands On','5','<ul>\r\n<li>Now take your downloaded background, and drag it into your wallpaper image.</li>\r\n<li>In the layers view, drag the background image layer (which will be on top) and move it behind the foreground:</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Layers View_kz4i9-uvyfcsupy.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Layers View_kz4i9-uvyfcsupy.png\" alt=\"\" /></a></p>\r\n<ul>\r\n<li>Now use the <span style=\"text-decoration: underline;\"><strong>move</strong></span> and <span style=\"text-decoration: underline;\"><strong>resize</strong></span> tools to put your background in just the right position.</li>\r\n</ul>','',11,'N'),
    (00000000062222,000000005430,00000000000008,000000039679,'Playtime','Hands On','15','<ul>\r\n<li>You now have some time to keep playing with your wallpaper.</li>\r\n<li>How can you improve the way your work looks?</li>\r\n</ul>','',12,'N'),
    (00000000062223,000000005430,00000000000008,000000039680,'Filters','Teacher Talk','20','<ul>\r\n<li>Filters are effects which you can apply to your graphics to make them look different.</li>\r\n<li>Filters can make your work more interesting, creative and original.</li>\r\n<li>Some fun filters to try include:\r\n<ul>\r\n<li>Motion blur</li>\r\n<li>Drop Shadow</li>\r\n<li>Tilt shift</li>\r\n</ul>\r\n</li>\r\n<li>Try to make your top layer active, and then apply a drop shadow. Reapply the same shadow a few times, and it will make the foreground appear to pop out from the background.</li>\r\n</ul>\r\n<p><a style=\"font-weight: bold;\" href=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Foreground Pop Example_qd39pijmcdfx0enj.png\" target=\"_blank\"><img class=\"resource\" style=\"max-width: 500px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://gibbon.ichk.edu.hk/uploads/2013/06/Foreground Pop Example_qd39pijmcdfx0enj.png\" alt=\"\" /></a></p>','',13,'N'),
    (00000000062224,000000005430,00000000000008,000000039681,'Playtime','Hands On','15','<ul>\r\n<li>You now have the remainder of the lesson to keep playing with your wallpaper.</li>\r\n<li>How can you improve the way your work looks?</li>\r\n</ul>','',14,'N'),
    (00000000062225,000000005430,00000000000009,000000039682,'Creative Commons License','Hands On','10','<ul>\r\n<li>As you are almost finished with your wallpaper, now is a good time to apply your Creative Commons License.</li>\r\n<li>Go to the <a style=\"font-weight: bold;\" href=\"http://creativecommons.org/choose\" target=\"_blank\">Creative Common License Chooser</a> and choose the license you want to use.</li>\r\n<li>Copy the license image and text to your work, and then add your attribution.</li>\r\n</ul>\r\n<hr />\r\n<p></p>\r\n<ul>\r\n<li><span style=\"background-color: #ff99cc;\"><strong>Going forward, you need to use Creative Commons for your ICT work, whenever you are</strong></span></li>\r\n<ul>\r\n<li><span style=\"background-color: #ff99cc;\"><strong>a) remixing work created by others or </strong></span></li>\r\n<li><span style=\"background-color: #ff99cc;\"><strong>b) creating work that you intend to share online</strong></span></li>\r\n</ul>\r\n</ul>','',15,'N'),
    (00000000062226,000000005430,00000000000009,000000039683,'Text Controls','Teacher Talk','10','<ul>\r\n<li>How much time do you spend thinking about text and font? Do you know any history?</li>\r\n</ul>\r\n<p><iframe width=\"560\" height=\"315\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"//www.youtube.com/embed/wOgIkxAfJsk\" frameborder=\"0\"></iframe></p>\r\n<ul>\r\n<li>When using Acorn, you have lots of&nbsp; control over text and how it is displayed. Some useful controls include:\r\n<ul>\r\n<li>Font type</li>\r\n<li>Kerning</li>\r\n<li>Line height</li>\r\n<li>Size</li>\r\n<li>Color</li>\r\n</ul>\r\n</li>\r\n<li>You can also get more fonts to install on your computer, from sites such as <a href=\"http://www.1001freefonts.com\">http://www.1001freefonts.com</a>.</li>\r\n<li>Can you make the text on your work look more interesting?</li>\r\n</ul>','',16,'N'),
    (00000000062227,000000005430,00000000000009,000000039684,'Playtime','Hands On','50','<ul>\r\n<li>You now have the remainder of the lesson to keep playing with your wallpaper.</li>\r\n<li>How can you improve the way your work looks?</li>\r\n</ul>','',17,'N'),
    (00000000062228,000000005430,00000000000010,000000039685,'Finish, Export & Submit','Hands On','50','<ul>\r\n<li>You now have 35 minutes to put the finishing touches on your work.</li>\r\n<li>The video below might help you if you are stuck getting your CC license set up and put into Acorn:</li>\r\n</ul>\r\n<p style=\"text-align: center;\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/0NFLmAlTDVE?rel=0\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<ul>\r\n<li>Leave enough time to save your work as a PNG file: png files can be opened by people who don\'t have Acorn, and are also smaller than Acorn files. When you save, you will lose your layers though, so keep the Acorn file as well in case you want to go back and edit some more.</li>\r\n<li>Finally, submit your work to Gibbon.</li>\r\n</ul>','',18,'N'),
    (00000000062229,000000005430,00000000000010,000000039686,'Raster vs. Vector','Teacher Talk','20','<ul>\r\n<li>To finish this unit, let\'s consider the ideas of <span style=\"text-decoration: underline;\"><strong>raster</strong></span> and <span style=\"text-decoration: underline;\"><strong>vector</strong></span> graphics.</li>\r\n<li>See <em>Teachers Notes</em> for details.</li>\r\n</ul>','<ul>\r\n<li>Teacher to introduce students to how graphics are represented, stored and displayed on computers.</li>\r\n<li>Most graphics programs store graphics as raster images. <br />\r\n<ul>\r\n<li>What is a raster?</li>\r\n<li>When are rasters good?</li>\r\n<li>Example raster formats? What are their strengths and weaknesses.</li>\r\n</ul>\r\n</li>\r\n<li>Some programs store graphics as vector images\r\n<ul>\r\n<li>What is a vector?</li>\r\n<li>When are vectors good?</li>\r\n<li>Example vector formats?</li>\r\n</ul>\r\n</li>\r\n<li>The Acorn file format (.acorn) uses raster for most elements, but some things (like text) are stored as vectors.</li>\r\n<li>Students should use the .acorn format whilst working on the box.</li>\r\n</ul>',19,'N');
